import { CardWidget } from "../CardWidget/CardWidget";
import "..CardWidget/";

export const NavBar = () => {
  return (
    <div className="contenedorNavBar">
      <p>
        <a href="">ICONO</a>
      </p>

      <div className="navBar_Items">
        <a href="">Productos</a>
        <a href="">Blog</a>
        <a href="">Contacto</a>
        <a href="">{CardWidget}</a>
      </div>
    </div>
  );
};
